 "Tip:": "\u03a3\u03c5\u03bc\u03b2\u03bf\u03c5\u03bb\u03ae:", 
 "Initial Zoom": "\u0391\u03c1\u03c7\u03b9\u03ba\u03ae \u039c\u03b5\u03b3\u03ad\u03b8\u03c5\u03bd\u03c3\u03b7", 
 "educational validator": "\u03b5\u03c0\u03b9\u03ba\u03cd\u03c1\u03c9\u03c3\u03b7 \u03b5\u03ba\u03c0\u03b1\u03b9\u03b4\u03b5\u03c5\u03c4\u03b9\u03ba\u03bf\u03cd \u03bc\u03ad\u03c1\u03bf\u03c5\u03c2", 
 "Background image for a header (an image 100px high is recommended).": "\u0395\u03b9\u03ba\u03cc\u03bd\u03b1 \u03c0\u03b1\u03c1\u03b1\u03c3\u03ba\u03b7\u03bd\u03af\u03bf\u03c5 \u03ba\u03b5\u03c6\u03b1\u03bb\u03af\u03b4\u03b1\u03c2 (\u03c0\u03c1\u03bf\u03c4\u03b5\u03af\u03bd\u03b5\u03c4\u03b1\u03b9 \u03b5\u03b9\u03ba\u03cc\u03bd\u03b1 \u03bc\u03b5 \u03cd\u03c8\u03bf\u03c2 100px).", 
 "training programmes, courses and plans": "\u03b5\u03ba\u03c0\u03b1\u03b9\u03b4\u03b5\u03c5\u03c4\u03b9\u03ba\u03ac \u03c0\u03c1\u03bf\u03b3\u03c1\u03ac\u03bc\u03bc\u03b1\u03c4\u03b1, \u03bc\u03b1\u03b8\u03ae\u03bc\u03b1\u03c4\u03b1 \u03ba\u03b1\u03b9 \u03c3\u03c7\u03ad\u03b4\u03b9\u03b1", 
