 "Enter a Red value (0-255)": "\u0395\u03b9\u03c3\u03ac\u03b3\u03b5\u03c4\u03b5 \u03bc\u03b9\u03b1 \u03c4\u03b9\u03bc\u03ae \u039a\u03cc\u03ba\u03ba\u03b9\u03bd\u03bf\u03c5 (0-255)", 
 "Your score will be saved after each question. You can only play once.": "\u0397 \u03b2\u03b1\u03b8\u03bc\u03bf\u03bb\u03bf\u03b3\u03af\u03b1 \u03c3\u03b1\u03c2 \u03b8\u03b1 \u03b1\u03c0\u03bf\u03b8\u03b7\u03ba\u03b5\u03cd\u03b5\u03c4\u03b1\u03b9 \u03bc\u03b5\u03c4\u03ac \u03b1\u03c0\u03cc \u03ba\u03ac\u03b8\u03b5 \u03b5\u03c1\u03ce\u03c4\u03b7\u03c3\u03b7. \u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03c0\u03b1\u03af\u03be\u03b5\u03c4\u03b5 \u03bc\u03cc\u03bd\u03bf \u03bc\u03af\u03b1 \u03c6\u03bf\u03c1\u03ac.", 
 "prove": "\u03b1\u03c0\u03cc\u03b4\u03b5\u03b9\u03be\u03b7", 
 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>\u0395\u03ac\u03bd \u03b4\u03b5\u03bd \u03b5\u03c0\u03b9\u03bb\u03b5\u03b3\u03b5\u03af, \u03ad\u03bd\u03b1\u03c2 \u03bc\u03b9\u03ba\u03c1\u03cc\u03c2 \u03b1\u03c1\u03b9\u03b8\u03bc\u03cc\u03c2 \u03bf\u03c1\u03b8\u03bf\u03b3\u03c1\u03b1\u03c6\u03b9\u03ba\u03ce\u03bd \u03bb\u03b1\u03b8\u03ce\u03bd \u03ba\u03b1\u03b9 \u03bb\u03b1\u03b8\u03ce\u03bd \u03b3\u03b9\u03b1 \u03c0\u03b5\u03b6\u03ac - \u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03b1 \u03b8\u03b1 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c0\u03bf\u03b4\u03b5\u03ba\u03c4\u03cc\u03c2. \u0391\u03bd \u03b5\u03c0\u03b9\u03bb\u03b5\u03b3\u03b5\u03af, \u03bc\u03cc\u03bd\u03bf \u03c4\u03bf \u03b1\u03ba\u03c1\u03b9\u03b2\u03ad\u03c2 \u03c4\u03b1\u03af\u03c1\u03b9\u03b1\u03c3\u03bc\u03b1 \u03c3\u03c4\u03b7\u03bd \u03bf\u03c1\u03b8\u03bf\u03b3\u03c1\u03b1\u03c6\u03af\u03b1 \u03ba\u03b1\u03b9 \u03c3\u03c4\u03b1 \u03c0\u03b5\u03b6\u03ac-\u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03b1 \u03b3\u03c1\u03ac\u03bc\u03bc\u03b1\u03c4\u03b1 \u03b8\u03b1 \u03b3\u03af\u03bd\u03b5\u03b9 \u03b1\u03c0\u03bf\u03b4\u03b5\u03ba\u03c4\u03cc.<\/p><p><strong>\u0393\u03b9\u03b1 \u03c0\u03b1\u03c1\u03ac\u03b4\u03b5\u03b9\u03b3\u03bc\u03b1:<\/strong> \u03b5\u03ac\u03bd \u03b7 \u03c3\u03c9\u03c3\u03c4\u03ae \u03b1\u03c0\u03ac\u03bd\u03c4\u03b7\u03c3\u03b7 \u03b5\u03af\u03bd\u03b1\u03b9 <code>\u0395\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2<\/code> \u03c4\u03cc\u03c4\u03b5 \u03ba\u03b1\u03b9 \u03c4\u03bf <code>\u03b5\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2<\/code> \u03ba\u03b1\u03b9 \u03c4\u03bf <code>\u0395\u03bb\u03af\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2<\/code> \u03b8\u03b1 \u03b8\u03b5\u03c9\u03c1\u03b7\u03b8\u03bf\u03cd\u03bd <em>'\u03b1\u03c1\u03ba\u03b5\u03c4\u03ac \u03cc\u03bc\u03bf\u03b9\u03b1'<\/em> \u03b1\u03c0\u03cc \u03c4\u03bf\u03bd \u03b1\u03bb\u03b3\u03cc\u03c1\u03b9\u03b8\u03bc\u03bf, \u03b4\u03b5\u03b4\u03bf\u03bc\u03ad\u03bd\u03bf\u03c5 \u03cc\u03c4\u03b9 \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9 \u03bc\u03cc\u03bd\u03bf \u03ad\u03bd\u03b1 \u03b3\u03c1\u03ac\u03bc\u03bc\u03b1 \u03bb\u03b1\u03bd\u03b8\u03b1\u03c3\u03bc\u03ad\u03bd\u03bf, \u03b1\u03ba\u03cc\u03bc\u03b1 \u03ba\u03b9 \u03b1\u03bd \u03bf '\u0388\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2 \u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03c9\u03bd - \u03c0\u03b5\u03b6\u03ce\u03bd' \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03bf\u03c2.<\/p><p>\u0391\u03bd \u03bf '\u0388\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2 \u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03c9\u03bd - \u03c0\u03b5\u03b6\u03ce\u03bd' \u03b5\u03af\u03bd\u03b1\u03b9 \u03b1\u03c0\u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03bf\u03c2 \u03c3\u03c4\u03bf \u03b1\u03bd\u03c9\u03c4\u03ad\u03c1\u03c9 \u03c0\u03b1\u03c1\u03ac\u03b4\u03b5\u03b9\u03b3\u03bc\u03b1, \u03c4\u03bf \u03c0\u03b5\u03b6\u03cc \u03b3\u03c1\u03ac\u03bc\u03bc\u03b1 <code>\u03b5<\/code> \u03b4\u03b5\u03bd \u03b8\u03b1 \u03b8\u03b5\u03c9\u03c1\u03b7\u03b8\u03b5\u03af \u03bb\u03ac\u03b8\u03bf\u03c2 \u03ba\u03b1\u03b9 \u03c4\u03bf <code>\u03b5\u03bb\u03af\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2<\/code> \u03b8\u03b1 \u03b3\u03af\u03bd\u03b5\u03b9 \u03b5\u03c0\u03af\u03c3\u03b7\u03c2 \u03b1\u03c0\u03bf\u03b4\u03b5\u03ba\u03c4\u03cc.<\/p><p>\u0391\u03bd \u03ba\u03b1\u03b9 \u03c4\u03b1 \u03b4\u03cd\u03bf, '\u0391\u03c5\u03c3\u03c4\u03b7\u03c1\u03cc\u03c2 \u03ad\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2' \u03ba\u03b1\u03b9 '\u0388\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2 \u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03c9\u03bd - \u03c0\u03b5\u03b6\u03ce\u03bd' \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03b1, \u03b7 \u03bc\u03cc\u03bd\u03b7 \u03c3\u03c9\u03c3\u03c4\u03ae \u03b1\u03c0\u03ac\u03bd\u03c4\u03b7\u03c3\u03b7 \u03b5\u03af\u03bd\u03b1\u03b9 '\u0395\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2'. \u0395\u03ac\u03bd \u03bc\u03cc\u03bd\u03bf \u03bf '\u0391\u03c5\u03c3\u03c4\u03b7\u03c1\u03cc\u03c2 \u03ad\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2' \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bd\u03b5\u03c1\u03b3\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03bf\u03c2 \u03ba\u03b1\u03b9 \u03bf '\u0388\u03bb\u03b5\u03b3\u03c7\u03bf\u03c2 \u03ba\u03b5\u03c6\u03b1\u03bb\u03b1\u03af\u03c9\u03bd - \u03c0\u03b5\u03b6\u03ce\u03bd' \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9, \u03c4\u03cc\u03c4\u03b5 \u03ba\u03b1\u03b9 \u03c4\u03bf '\u03b5\u03bb\u03ad\u03c6\u03b1\u03bd\u03c4\u03b1\u03c2' \u03b8\u03b1 \u03b3\u03af\u03bd\u03b5\u03b9 \u03b1\u03c0\u03bf\u03b4\u03b5\u03ba\u03c4\u03cc.<\/p >", 
