 "A new Definition List will be created.\nTo add a new term, just place the cursor at the end of a definition and click again the Definition List button.\n": "\u039c\u03b9\u03b1 \u03bd\u03ad\u03b1 \u03bb\u03af\u03c3\u03c4\u03b1 \u03bf\u03c1\u03b9\u03c3\u03bc\u03ce\u03bd \u03b8\u03b1 \u03b4\u03b7\u03bc\u03b9\u03bf\u03c5\u03c1\u03b3\u03b7\u03b8\u03b5\u03af.\n\u0393\u03b9\u03b1 \u03bd\u03b1 \u03c0\u03c1\u03bf\u03c3\u03b8\u03ad\u03c3\u03b5\u03c4\u03b5 \u03ad\u03bd\u03b1\u03bd \u03bd\u03ad\u03bf \u03cc\u03c1\u03bf, \u03c4\u03bf\u03c0\u03bf\u03b8\u03b5\u03c4\u03ae\u03c3\u03c4\u03b5 \u03c4\u03bf\u03bd \u03b4\u03b5\u03af\u03ba\u03c4\u03b7 \u03c3\u03c4\u03bf \u03c4\u03ad\u03bb\u03bf\u03c2 \u03c4\u03bf\u03c5 \u03bf\u03c1\u03b9\u03c3\u03bc\u03bf\u03cd \u03ba\u03b1\u03b9 \u03c0\u03b9\u03ad\u03c3\u03c4\u03b5 \u03c0\u03ac\u03bb\u03b9 \u03c4\u03bf \u03c0\u03bb\u03ae\u03ba\u03c4\u03c1\u03bf \u03c4\u03b7\u03c2 \u03bb\u03af\u03c3\u03c4\u03b1\u03c2 \u03bf\u03c1\u03b9\u03c3\u03bc\u03ce\u03bd.\n", 
